import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "stop";
const pathData = "M256.5 0c140 0 255 115 255 256 0 140-115 255-255 255-141 0-256-115-256-255 0-141 115-256 256-256zm0 460c112 0 204-92 204-204 0-113-92-205-204-205-113 0-205 92-205 205 0 112 92 204 205 204zm76-306c16 0 26 10 26 25v154c0 15-10 25-26 25h-153c-15 0-26-10-26-25V179c0-15 11-25 26-25h153z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
